import styled from 'styled-components';


const Container = styled.div`
    position:relative;
    width:100%;
    height:100%;
    background-color:#d5def5;
    display:flex;
    justify-content:space-around;
    flex-wrap:wrap;
    align-items:center;
`;

function Technology() {
  return (
    <Container>Technology</Container>
  )
}

export default Technology;
